import logo from './components/images/Octicons-mark-github.svg';
import './App.css';
import Navbar from './components/Navbar';
function App() {
  return (
          <div className="App">
                  <header>
                    <h1 id ="name">
                      <div className ="logo">Alex<br/>Barbosa
                      </div>
                    </h1>
                <Navbar/>
              </header>
        <img src={logo} className="App-logo" alt="logo" />

              <div id="content">
                <div id="aboutmecontent">
                  I am an avid technology enthusiast and gamer. When Im not working on one of my many hobbies, I am probably gaming. I was born and raised in New York, and still reside there. I graduated from Rensselaer Polytechnic Institute in 2013. After graduating I was employed by Citigroup on their tax technology team. I am currently going through a career change and am on the path of becoming a software engineer. My first steps were enrolling in General Assembly's Software Engineering Imersive.
                </div>
              </div>
              <a href="/tarkov.html"> TARKOV PAGE</a>

            <footer><div className ="Socials"><img src="./components/images/Octicons-mark-github.svg" alt = "github"/></div>Copyright &copy; Alex Barbosa</footer>
          </div>
  );
}

export default App;
